import React from 'react';
import './ReceiveDiagnosis.css';

const ReceiveDiagnosis = () => {
  return (
    <div className="ppt-slide" style={{ backgroundImage: `url(${process.env.PUBLIC_URL}/eyeexamination.jpg)` }}>
      <div className="background-overlay"></div>
      <div className="content">
        <h1>Receive Diagnosis</h1>
        <p>
        For individuals who are blind in New York, embarking on the road to independence often starts with establishing contact with the New York State Commission for the Blind (NYSCB).
        </p>
        <p>The first step in accessing services from NYSCB typically involves submitting diagnostic results or proof of legal blindness, which can be obtained through schools, medical professionals, private agencies for the blind, or other community, health, or social service organizations.</p>
        <p>To initiate this journey towards independence, obtaining a prescription from an eye clinic or hospital following an eye examination by a licensed ophthalmologist is necessary. The professional will officially diagnose "legal blindness".</p>
        <audio controls>
          <source src="path_to_audio_file.mp3" type="audio/mpeg" />
          Your browser does not support the audio element.
        </audio>
        <div className="resources">
          <h2>External Resources</h2>
          <ul>
            <li><a href="https://example.com/resource1" target="_blank" rel="noopener noreferrer">Resource 1</a></li>
            <li><a href="https://example.com/resource2" target="_blank" rel="noopener noreferrer">Resource 2</a></li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default ReceiveDiagnosis;
